double equivalent_contact_angle (double R, double V)
{
  double x0 = 0., x1 = 3.14159265358979;
  while (x1 - x0 > 1e-4) {
    double x = (x1 + x0)/2.;
    double f = V - ( R*R)*(x - sin(x)*cos(x));
    if (f > 0.)
      x0 = x;
    else
      x1 = x;
  }
  return (x0 + x1)/2.;
}

